let $ = document.querySelector.bind(document);
let $$ = document.querySelectorAll.bind(document);
let log = console.log.bind(console);
Element.prototype.$ = Element.prototype.querySelector
Element.prototype.$$ = Element.prototype.querySelectorAll
function createElement(tag_name, attrs){
    let ele = document.createElement(tag_name);
    for(let key in attrs){
        if(key === 'class') ele.className = attrs[key];
        else ele.setAttribute(key, attrs[key]);
    }
    return ele;
}
function insertBefore(ref_ele, ele){
    ref_ele.parentNode.insertBefore(ele, ref_ele);
}
function insertAfter(ref_ele, ele){
    ref_ele.parentNode.insertBefore(ele, ref_ele.nextSibling);
}
function injectCSSText(text, name) {
    let style = document.createElement('style');
    style.innerHTML = text;
    if (name) style.id = name;
    document.head.appendChild(style);
}

