const site_icon_data = {"zhihu":"data:image/vnd.microsoft.icon;base64,","bili":"data:image/x-icon;base64,","tieba":"data:image/x-icon;base64,","weibo":"data:image/x-icon;base64,"}

function storeRecent(name) {
    let recent_emotions = JSON.parse(GM_getValue('recent-emotions') || '[]')
    if (name) {
        let i = recent_emotions.indexOf(name)
        if (i != -1) recent_emotions.splice(i, 1)
        recent_emotions.unshift(name)
    }
    if (recent_emotions.length > 9) recent_emotions.pop()
    GM_setValue('recent-emotions', JSON.stringify(recent_emotions))
}

function init() {
    let new_emotion_box = createElement('div')
    new_emotion_box.id = 'new_emotion_box'
    new_emotion_box.style = 'position: fixed; bottom: 0; left: 0; right: 0; z-index: 99999;'
    new_emotion_box.classList.add('hide')
    new_emotion_box.innerHTML = new_emotion_box_html
    let tab_html = '', block_html = ''
    for (let sitename in all_emotions) {
        const emotions = all_emotions[sitename]
        tab_html += `
            <i class="emotionbox-filter" title="${sitename}">
                <img class="emojioneemoji" src="${site_icon_data[sitename]}">
            </i>
        ` //https://cdn.jsdelivr.net/emojione/assets/3.1/png/32/1f60b.png
        block_html += `<div class="emotionbox-category" name="${sitename}"><div class="emotionbox-category-title">${sitename}</div>`
        for (let ename of emotions) {
            block_html += `
            <i class="emojibtn" role="button" title="${ename}" name="${sitename+'_'+ename}">
                <img class="emojioneemoji" data-src="${all_emotions_src[sitename][ename]}" src="data:image/png;base64,${all_emotions_data[sitename][ename]}">
            </i>
            `
        }
        block_html += '</div>'
    }
    new_emotion_box.$('.emotionbox-filters').innerHTML += tab_html
    new_emotion_box.$('.emotionbox-category-block').innerHTML += block_html
    new_emotion_box.addEventListener('click', ev => {
        let ele = ev.target
        let img_ele = null
        let tab_ele = null
        if (ele.classList.contains('emojibtn'))
            img_ele = ele.firstElementChild
        else if (ele.parentNode.classList.contains('emojibtn'))
            img_ele = ele
        else if (ele.classList.contains('emotionbox-filter'))
            tab_ele = ele
        else if (ele.parentNode.classList.contains('emotionbox-filter'))
            tab_ele = ele.parentNode
        if (img_ele) {
            const name = img_ele.parentNode.attributes.name.value //sitename和ename连接的文本
            $('.TextEditor-editor').value += `![emo_${name}](${img_ele.dataset.src})`
            storeRecent(name)
            new_emotion_box.classList.add('hide')
        } else if (tab_ele) {
            [].slice.call(tab_ele.parentNode.children).forEach(e => e.classList.remove('active'))
            tab_ele.classList.add('active')
            let top = $(`.emotionbox-category[name=${tab_ele.title}] .emotionbox-category-title`).offsetTop
            $('.emotionbox-scroll-area').scrollTo({top: top, behavior: 'smooth'})
        }

    })
    new_emotion_box.$('.search').addEventListener('input', ev => {
        const keyword = ev.target.value
        if (!keyword) {
            new_emotion_box.$$(`.emojibtn`).forEach(e => e.classList.remove('hide'))
            return
        }
        new_emotion_box.$$(`.emojibtn`).forEach(e => e.classList.add('hide'))
        new_emotion_box.$$(`.emojibtn[title*=${keyword}]`).forEach(e => e.classList.remove('hide'))
    })
    document.body.appendChild(new_emotion_box)

    let editbox = $('#composer .Composer')
    let toolbar = editbox.$('.TextEditor-toolbar')
    let new_emotion_btn = toolbar.lastElementChild.cloneNode(true)
    new_emotion_btn.classList.remove('Button-emojionearea')
    new_emotion_btn.classList.add('Button-new_emotion')
    toolbar.appendChild(new_emotion_btn)
    new_emotion_btn.addEventListener('click', ev => {
        let recent_emotions = JSON.parse(GM_getValue('recent-emotions') || '[]')
        log(recent_emotions)
        let recent_html = `<div class="emotionbox-category-title">recent</div>`
        for (let re of recent_emotions) {
            if (!re) continue
            const i = re.indexOf('_')
            const sitename = re.slice(0, i), ename = re.slice(i + 1, re.length)
            recent_html += `
            <i class="emojibtn" role="button" title="${ename}" name="${sitename+'_'+ename}">
                <img class="emojioneemoji" data-src="${all_emotions_src[sitename][ename]}" src="data:image/png;base64,${all_emotions_data[sitename][ename]}">
            </i>
            `
        }
        new_emotion_box.$('.emotionbox-category[name="recent"]').innerHTML = recent_html
        new_emotion_box.classList.toggle('hide')
    })
}

(function() {
    'use strict';
    injectCSSText(style, 'new_emotion')
    let editing_post_body = null
    const editbox_observer = new MutationObserver((mutationRecords) => {
        for (let m of mutationRecords) {
            if (m.attributeName == 'class') {
                if ($('#composer .Composer').classList.contains('normal')) //是编辑框打开的状态
                    if (!$('.Button-new_emotion')) init()
                else {
                }
            }
        }
    })
    editbox_observer.observe($('#composer'), { subtree: true, attributes: true, attributeFilter: ['class'] })
})();